Un honor y privilegio formar parte como autor y voz de la apertura de los Juegos Olímpicos Tokyo 2020 por 
@telemundodeportes @telemundo 

La llama olímpica es un mensaje de valentía de épocas pasadas, construye la amistad entre los pueblos, los acerca en competencia leal, y los hermana. En su flama se aprende a respetar y amar la diversidad de las naciones.

En esta competencia se soporta y se aprovecha todo: la fatiga y la duda, el temor y la derrota, por lo que hay que insistir con elevadas dosis de tesón y confianza, de coraje y fe. La clave es medir, ajustar, persistir e intentarlo de nuevo.

La victoria y la derrota no tienen idioma, ni color, un podio como ejemplo de sacrificio y valor donde se funden las banderas como una sola lección: Se puede vivir compitiendo en armonía, sin terror y opresión. La posibilidad de un mundo donde todos tengamos un espacio donde abrazarnos. 

Hay atletas que parecen pájaros; otros, fieras arañando la grava, un colchón, una varilla, un carril, astillas en los huesos, clavículas que se rompen, tendones de arcilla, brazos de relámpago. Son Apolos y Afroditas combatiendo, llevan las rodillas del obrero, las llagas del marginado, los sueños de los niños, los recuerdos del anciano, los cuerpos cincelados por el esfuerzo; sus músculos soportan las tristezas y sueños de sus patrias, toda una vida entrenando para disminuir la marca, conscientes que dé posibilidad a historia hay un segundo de diferencia. ¡Quien apuesta por la inmortalidad se hace atleta!

Estos son los rostros de quienes nos representan. Muchos quisimos ser atletas hasta que nos dimos cuenta de que es algo que se consigue a un precio muy alto, demanda un sacrificio sin reservas. Solo quienes se superan así mismos pueden reclamar la gloria; son esos los que se convierten en ídolos, los que se transforman en cultura conscientes que dé posibilidad a historia hay un segundo de diferencia.

¡NOS VEMOS EN EL PODIO!

